"use client"

import React from 'react';

const SongSwipe = ({ imagePath, title, artist }) => {
  return (
    <div style={{ textAlign: 'center'}}>
      <img src={imagePath} alt="Album Cover" style={{ width: '200px', height: '200px', borderRadius: '50%' }} />
      <h3 id="title">{title}</h3>
      <p id="artist">{artist}</p>
      <div>
        <button>
          <img
            src={require("./icons8-end-50.png")}
            style={{width: '20px', height: '20px', marginBottom: 0}} 
          />
        </button>
      </div>
    </div>
  );
};

export default SongSwipe;
